import React from "react";

function Button({
  padding,
  altname,
  imgSrc,
  btnName,
  width,
  bgColor = "#a259ff",
}) {
  const style = {
    display: "flex",
    gap: "1.2rem",
    alignItems: "center",
    justifyContent: "center",
    padding: padding,
    color: "white",
    fontSize: "1.6rem",
    fontWeight: "600",
    backgroundColor: bgColor,
    borderRadius: "20px",
    textDecoration: "none",
    maxWidth: width,
  };

  return (
    <a href="" style={style}>
      <img src={imgSrc} alt={altname} style={{ backgroundColor: "red" }} />
      {btnName}
    </a>
  );
}

export default Button;
